import React from 'react';
import Header from '../SharedPage/Header/Header';
import About from './About/About';
import Banner from './Banner/Banner';
import './Home.css';
import Services from './Services/Services';
import Skills from './Skills/Skills';

const Home = () => {
    return (
        <div className="home">
            <Header />
            <Banner />
            <About />
            <Skills />
            <Services />
            <Projects />
        </div>
    );
};

export default Home;
